import React from 'react';
import './App.css';
import Particles from 'react-particles-js';
import Microphone from './Microphone';

const App=()=>{

    return (
      <div className="App">
      <Particles
              params={{
            		particles: {
            			line_linked: {
            				shadow: {
            					enable: true,
            					color: "#3CA9D1",
            					blur: 5
            				}
            			}
            		}
            	}}

            />
      <Microphone />
      </div>
    );

}

export default App;
